●クランプで工作台に自由に取り付け、取り外しができます。●板を挟む下の部分で、パイプを挟む形状で便利です。●金属の丸パイプを金切りノコで切断したり、パイプを固定するときに適しています。<BR>●金属の丸パイプを金切りノコで切断したり、パイプを固定するときに。●物を強力に、しかも持続的に挟んだり、固定する工具で、工作物を固定する作業に。<BR>●全長(mm):104●幅(mm):63●高さ(mm):200●口幅(mm):63●口開(mm):50●口深さ(mm):16●締付力(kN):2.6●クランプ最大口開き(mm):5～33●質量(kg):1.2<BR>●本体:鋳物●シャフト:鉄●ハンドル:鉄<BR><tr><td colspan="2">
